import {Button, StyleSheet, Text, View ,Image} from 'react-native';
import {useState} from 'react'
import Notification from './assets/Img/notification.png'
import BurgerMenu from './assets/Img/burger-bar.png'

export default function App() {
  return (
      <View style={styles.container}>
        <View style={styles.HeaderContainer} >
          <View style={styles.HeaderContainer.HeaderContainerIcons}>
            <Image source={BurgerMenu} style={styles.HeaderContainer.HeaderContainerIcons.Burger} />
          </View>
          <Text style={styles.HeaderContainer.Logo}>Fast Food</Text>
          <View style={styles.HeaderContainer.HeaderContainerIcons}>
            <Image source={Notification} style={styles.HeaderContainer.HeaderContainerIcons.Notification} />
          </View>
        </View>
        <View  style={styles.BodyContainer}>
          <Text>Body</Text>
        </View>
        <View  style={styles.FooterContainer} >
          <Text>Footer</Text>
        </View>
      </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
  },
  HeaderContainer:{
    padding:20,
    flex:1,
    backgroundColor: "orange",
    paddingVertical:50,
    flexDirection: "row",
    justifyContent:"space-between",
    alignItems:"center",
    HeaderContainerIcons:{
        backgroundColor: "#e5e5e5",
        borderRadius:6,
        padding:5,
        Notification:{
          width: 42,
          height: 42,
        },
        Burger:{
          width: 38,
          height: 38,
        }
    },
    Logo:{
      color:'red',
      fontSize:30,
      fontFamily: 'Roboto'
    }
  },

  BodyContainer:{
    padding:5,
    flex:10,
    backgroundColor: "red"
  },
  FooterContainer:{
    padding:5,
    flex:1,
    backgroundColor: "yellow"
  }
});
